import './uploads.css';
import './main.css';

function Home() {
  return (
    <div>
      <h1 class="top-heading"> <img
        src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
        width="50"
        height="55"
        alt="MoodMelody Logo"
      /> MoodMelody </h1>
      <h2 class="sub-Heading">Share Your Moment</h2>
      <h4 class="Description">Upload a video and let our AI create a personalized story and suggest music for you... </h4>
      <div class="container">
        <div class="row">
          <div class="col-12">col</div>
        </div>
      </div>



    </div>
  );
}
export default Home;
